// Projects.js
import React from 'react';
import './projects.css';
import Navbar from './Navbar';

const Projects = () => {
  return (
    <div className="projects-container">
      <Navbar />
      <div className="hero" style={{ backgroundImage: 'url(/projectshero.png)' }}>
        <h1>Projects</h1>
      </div>
      <div className="project-sections">
        <div className="project-section">
          <h2>AnyModel Project</h2>
          <p>
            web application using modern technologies.
          </p>
          <img src="https://via.placeholder.com/150" alt="Project 1" />
        </div>
        <div className="project-section">
          <h2>Project Title 2</h2>
          <p>
            Description for project 2. This project is focused on cybersecurity and ethical hacking practices.
          </p>
          <img src="https://via.placeholder.com/150" alt="Project 2" />
        </div>
        <div className="project-section">
          <h2>Project Title 3</h2>
          <p>
            Description for project 3. This project includes machine learning and AI model training.
          </p>
          <img src="https://via.placeholder.com/150" alt="Project 3" />
        </div>
        {/* Add more sections as needed */}
      </div>
    </div>
  );
};

export default Projects;
